function mobile_menu(x) {
    var element = document.getElementById(x);
    var viewportmeta = document.querySelector('meta[name="viewport"]');
    window.scrollTo(0, 0);
    var animSpeed = 0;
    var activeToggleSpeed = 0;
    if (document.documentElement.clientWidth + $.scrollbarWidth() > 640) {
        animSpeed = .75;
        activeToggleSpeed = 800;
    }
    if (document.documentElement.clientWidth + $.scrollbarWidth() <= 640) {
        animSpeed = 1;
        activeToggleSpeed = 1050;
    }
    element.handled = false;
    if (element.className.indexOf(" active") == -1 && x == "mobile_nav_flyout_left") {
        element.className = element.className.replace(" inactive", " active");
        active_menu = x;
        TweenLite.to(document.getElementById("mobile_nav_flyout_left"), animSpeed, { x: "0%" }, { force3D: true, ease: Quad.easeInOut });
        TweenLite.to(document.getElementById("page_center"), animSpeed, { x: "80%" }, { force3D: true, ease: Quad.easeInOut });
        element.handled = true;
    }
    if (element.className.indexOf(" active") != -1 && x == "mobile_nav_flyout_left" && element.handled == false) {
        TweenLite.to(document.getElementById("mobile_nav_flyout_left"), animSpeed, { x: "-100%" }, { force3D: true, ease: Quad.easeInOut });
        TweenLite.to(document.getElementById("page_center"), animSpeed, { x: "0%" }, { force3D: true, ease: Quad.easeInOut });
        var t = setTimeout(function () {
            element.className = element.className.replace(" active", " inactive");
            document.getElementById("page_center").className = document.getElementById("page_center").className.replace(" active", " inactive");
            element.handled = true;
        }, activeToggleSpeed);
        active_menu = "";
    }
    if (element.className.indexOf(" active") == -1 && x == "mobile_nav_flyout_right") {
        element.className = element.className.replace(" inactive", " active");
        active_menu = x;
        TweenLite.to(document.getElementById("mobile_nav_flyout_right"), animSpeed, { x: "0%" }, { force3D: true, ease: Quad.easeInOut });
        TweenLite.to(document.getElementById("page_center"), animSpeed, { x: "-80%" }, { force3D: true, ease: Quad.easeInOut });
        element.className = element.className.replace(" inactive", " active");
        element.handled = true;
    }
    if (element.className.indexOf(" active") != -1 && x == "mobile_nav_flyout_right" && element.handled == false) {
        TweenLite.to(document.getElementById("mobile_nav_flyout_right"), animSpeed, { x: "100%" }, { force3D: true, ease: Quad.easeInOut });
        TweenLite.to(document.getElementById("page_center"), animSpeed, { x: "0%" }, { force3D: true, ease: Quad.easeInOut });

        // Upromise addition 
        if (mobile_sub_nav_flyout_.length) {
            for (i = 0; i < mobile_sub_nav_flyout_.length; i++) {
                TweenLite.to(document.getElementById("mobile_sub_nav_flyout_" + i), animSpeed, { x: "100%" }, { force3D: true, ease: Quad.easeInOut });
                document.getElementById("mobile_sub_nav_flyout_" + i).className = document.getElementById("mobile_sub_nav_flyout_" + i).className.replace(" active", " inactive");
            }
        }
        var t = setTimeout(function () {
            element.className = element.className.replace(" active", " inactive");
            document.getElementById("page_center").className = document.getElementById("page_center").className.replace(" active", " inactive");
            element.handled = true;
        }, activeToggleSpeed);
        active_menu = "";
    }
    accordionHeight();
    window.focus(document.getElementById(active_menu));
}

