/* Begin Accordion */

function accordionHeight() {
    $('.accordion_content').each(function () {
        $(this).css('height', 'auto');
        $(this).attr('originalheight', $(this).height());
        if ($(this).prev()[0].className.indexOf(" active") == -1) {
            $(this).css('height', '');
        }
    });
}

$(document).ready(function () {
    accordionHeight();
});

accordionHandled = true;

function more(x) {
    accordionHandled = false;
    setTimeout(function () {
        accordionHandled = true;
    }, 010);
    var element = x;
    var parent = element.parentNode;
    var content = $(parent).next()[0];
    if (document.documentElement.clientWidth + $.scrollbarWidth() > 640 <= 850 && parent.className.indexOf("accordion_medium") == -1) {
        return false;
    }
    if (document.documentElement.clientWidth + $.scrollbarWidth() > 850 && parent.className.indexOf("accordion_large") == -1) {
        return false;
    }
    if (element.className.indexOf(" active") == -1) {
        element.className = element.className.replace(element.className, element.className + " active").replace(" inactive", "");
        parent.className = parent.className.replace(parent.className, parent.className + " active").replace(" inactive", "");
        TweenLite.to(content, .3, { height: $(content).attr('originalheight') }, { force3D: true, ease: Quad.easeInOut });
        for (i = 0; i < element.childNodes.length; i++) {
            if (element.childNodes[i].className != null && element.childNodes[i].className.indexOf("plus_minus") != -1) {
                element.childNodes[i].innerHTML = "";
                element.childNodes[i].innerHTML = "<span class='fa-minus'></span>";
            }
        }
    }
    else {
        element.className = element.className.replace(" active", " inactive");
        parent.className = parent.className.replace(" active", " inactive");
        TweenLite.to(content, .3, { height: 0 }, { force3D: true, ease: Quad.easeInOut });
        for (i = 0; i < element.childNodes.length; i++) {
            if (element.childNodes[i].className != null && element.childNodes[i].className.indexOf("plus_minus") != -1) {
                element.childNodes[i].innerHTML = "";
                element.childNodes[i].innerHTML = "<span class='fa-plus'></span>";
            }
        }
    }
}

/* End Accordion */

/* Begin Tabs */

function arraybuilder(x) {
    var funcname = x.split("_")[0];
    var arrayname = funcname + "s";
    var itemtype = funcname + ("_");
    for (i = 0; i != -1; i++) {
        if (document.getElementById(itemtype + i) == null) {
            break;
        }
        var numitems = i + 1;
    }
    arrayname = new Array(numitems);
    for (i = 0; i < numitems; i++) {
        if (document.getElementById(itemtype + i) == null) {
            break;
        }
        arrayname[i] = document.getElementById(itemtype + i);
    }
    window[funcname](x, arrayname);
}

function tab(x, y) {
    var tabNameSync = "";
    if (document.getElementById(x).className.indexOf("active") == -1) {
        var itemnumber = x.split("_")[1];
        for (i = 0; i < y.length; i++) {

            var sectionShow = document.getElementById('section_' + i);
            if (y[i].id != y[itemnumber].id) {
                y[i].className = y[i].className.replace(" active", "");
                sectionShow.className = sectionShow.className.replace("show", "hide");
            }
            if (y[i].id == y[itemnumber].id) {
                y[i].className = y[i].className.replace(y[i].className, y[i].className + " active");
                sectionShow.className = sectionShow.className.replace("hide", "show");
                tabNameSync = y[i].getElementsByTagName("a")[0].innerHTML;
            }
        }

        for (i = 0; i < y.length; i++) {
            if (y[i].getElementsByTagName("a")[0].innerHTML == tabNameSync && y[i].className.indexOf("active") == -1) {
                y[i].className = y[i].className.replace(y[i].className, y[i].className + " active");
                var sectionSync = document.getElementById("section_" + y[i].id.split("_")[1]);
                sectionSync.className = sectionSync.className.replace("hide", "show");
            }

        }
    }
}

/* End Tabs */

/* Begin Select Hider */

function select_hider(x, y, z) {
    var index = document.getElementById(z).selectedIndex;
    var matches = document.getElementById(z).getElementsByTagName("option")[index].value.split(",");
    var all = getElementsByClassName(x, y);
    for (i = 0; i < all.length; i++) {
        all[i].style.display = "none";
    }
    for (h = 0; h < matches.length; h++) {

        all[matches[h]].style.display = "block";
        if (select_hider_animate == true) {
            if ($("#special_title").length) {
                var target = $("#special_title");
            }
            else {
                var target = $("#" + x + " > ." + y + ":eq(" + matches[h] + ")");
            }
            $('html,body').animate({
                scrollTop: target.offset().top - 30
            }, 1000);
        }
        select_hider_animate = true;
    }
}

window.select_hider_animate = true;

$(document).ready(function () {
    if (location.search.indexOf("force_first_scroll=yes") == -1) {
        select_hider_animate = false;
    }
    if (location.search.indexOf("select_hider=") != -1) {
        var selectHider = getParameter("select_hider");
        var paramsSplit = $("#" + selectHider).attr("onchange").split("select_hider(")[1].split(")")[0];
        var x = paramsSplit.split(",")[0].replace("'", "").replace("'", "");
        var y = paramsSplit.split(",")[1].replace("'", "").replace("'", "");
        var z = paramsSplit.split(",")[2].replace("'", "").replace("'", "");
        if (z == "this.id" || z == "this") {
            z = $("#" + selectHider).attr("id");
        }
        if (location.search.indexOf("selected_option=") != -1) {
            $("#" + selectHider).val(getParameter("selected_option"));
        }
        else {
            select_hider_animate = true;
        }
        select_hider(x, y, z);
    }

})

/* End Select Hider */

/* element toggle */
function toggle(x) {
    var element = document.getElementById(x);
    $(element).toggle();
}

/* tool tip */

$(".tip-link").on("mouseenter", function (e) {
    if (phoneDevice == false) {
        if (this.className.indexOf("thumb") != -1) {
            var thumbExpander = document.createElement("img");
            var theSrc = this.src;
            thumbExpander.setAttribute('src', theSrc);
            thumbExpander.setAttribute('class', 'tool-tip');
            thumbExpander.setAttribute('id', 'current-expand');
            this.setAttribute('id', 'current-thumb');
            $("body").append(thumbExpander);
            e.handled = true;
        }
    }
});

$(".tip-link").on("mouseleave", function (e) {
    if (phoneDevice == false) {
        if (this.className.indexOf("thumb") != -1) {
            $("#current-expand").remove();
            this.setAttribute('id', '');
        }
    }
});

$(document).on('mousemove', function (e) {
    if (phoneDevice == false) {
        if (document.getElementById("current-expand") != null) {
            var theThumb = document.getElementById("current-thumb");
            var theExpand = document.getElementById("current-expand");
            theExpand.style.left = e.pageX + 20 + "px";
            theExpand.style.top = e.pageY - theThumb.offsetHeight + "px";
        }
    }
});

/* End DISPLAY CHANGER */

/* SELECT NAV */
function select_nav(x) {
    var index = document.getElementById(x).selectedIndex;
    var option = document.getElementById(x).getElementsByTagName("option")[index].value;
    window.location.href = option;
}
/* End SELECT NAV */

/* Begin Tokens */

tokenslist = "";

tokens_i = 0;

function tokens() {
    tokenslist = getElementsByClassName("body", "token");

    if (tokens.length > -1) {
        $.ajax({
            url: '/tokens.aspx',
            type: 'GET',
            dataType: 'xml',
            success: function (xml) {
                tokensRepeater(xml);
            }
        });
    }
}

function tokensRepeater(xml) {
    var loopcount = 0;
    for (i = tokens_i; i < tokenslist.length; i++) {
        if ($('tokens', xml).find(tokenslist[i].id) != null) {
            tokenslist[i].innerHTML = $('tokens', xml).find(tokenslist[i].id).text();
        }
        tokens_i++;
        loopcount++;
        if (loopcount > 40) {
            setTimeout(function () { tokensRepeater(xml) }, 0);
            break;
        }
    }
}

function footnotes() {
    var footnotes = getElementsByClassName("body", "footnote");
    var footnoteTitles = new Array(footnotes.length);
    if (footnotes.length > -1) {
        for (i = 0; i < footnotes.length; i++) {
            footnoteTitles[i] = footnotes[i].id;
            var fTokens = getElementsByClassName("body", footnoteTitles[i] + "_token");
            for (j = 0; j < fTokens.length; j++) {
                fTokens[j].innerHTML = i + 1;
            }
        }
    }
}
/* End Tokens */

